import React from 'react';
import history from '../../history';

import './Result.css';

class Result extends React.Component {

    render() {
        return (
            <div className="Result">
               Result
               <br />
                <form>
                    <button onClick={() => history.push('/game')}>go to Game</button>
                </form>
            </div>
        );
    }
}

export default Result;
